import express from "express";
import morgan from 'morgan';
import TaskRoutes from "./routes/taks.routes";

const app = express();


//middlewares
app.use(morgan('dev'));
app.use(express.json());
app.use(express.urlencoded({extended: false}));

// routes
app.get("/", (req, res) => {
  res.json({ message: "hola mundo de nodejs" });
});

app.use("/api/tasks", TaskRoutes);

export default app;

