import Seller from "../models/Seller"


export const findAllSellers = async (req, res) => {
    const sellers = await Seller.find();
    res.json(sellers)
}


export const createSeller = async (req, res ) =>{
            const newSeller = new Seller({Name: req.body.Name, LastName: req.body.LastName, Email: req.body.Email})
            console.log(newSeller);
            const sellerSaved = await newSeller.save();
            res.json(sellerSaved);
            // console.log('saving a new seller');
}


export const finOneSeller =  async (req, res) => {
    const newSeller = await Seller.findById(req.params.id)
    res.json(newSeller)
}


export const deleteSeller = async (req, res) => {
    await Seller.findByIdAndDelete(req.params.id)
    res.json({
        message: 'seller was deleted succesfully'
    })
}


export const findByName = async (req, res) =>{
    const sellerByName = await Seller.find({Name: req.params.name})
    res.json(sellerByName)
}


export const updateSeller = async (req, res) => {
    await Seller.findByIdAndUpdate(req.params.id, req.body)
    res.json({message: 'Seller was updated successful'})
}

